const CardContents = [
    {
        title: 'Buy and Sell Collectibles',
        description:
            "Collector allows you to buy and sell all manners of collectibles all in one place.",
        imageURL: process.env.PUBLIC_URL + '/assets/buying.jpg',
        time: 1500
    },
    {
        title: 'Interact with other Collectors',
        description:
            "Use our discussion boards and comment sections to communicate with other collectors.",
        imageURL: process.env.PUBLIC_URL + '/assets/discussion.jpg',
        time: 1500

    },
];

export default CardContents;
